import '../../App.css';
import Footer from "../Footer";

export default function Alice() {

    useEffect(() => {
        window.scrollTo(0, 0);
    }, []);

    return (
        <>
            <div className="content">
                <h1 className="sub-heading">ALICE</h1>
            </div>



            <Footer />

        </>
    );
}
